import React from 'react';

const AdminControls = ({ pageNumber, numPages, changePage }) => {
  return (
    <div>
      <button
        onClick={() => changePage(-1)}
        disabled={pageNumber <= 1}
      >
        Previous
      </button>
      <button
        onClick={() => changePage(1)}
        disabled={pageNumber >= numPages}
      >
        Next
      </button>
    </div>
  );
};

export default AdminControls;
